function Mapper(stage, gamestage) {
	this.map2 = mapData3;
	this.tileset = new Image();
	this.mapData = mapData2;
	this.stage = stage;
	this.gamestage = gamestage;
	this.heightOffset = null;
	this.widthOffset = null;
	this.collisionArray = [[],[]];
	this.container = new createjs.Container();
	this.container.x = 0;
	this.container.y = 0;
	this.advancing = false;
	this.advancecount = 0;
	this.reversing = false;
	this.reversecount = 0;

	// figure out offsets:
	this.heightOffset = this.gamestage.canvas.height - this.mapData.tilesets[0].tileheight * this.mapData.layers[0].height;
	if (this.gamestage.canvas.width > this.mapData.tilesets[0].tilewidth * this.mapData.layers[0].width) {
		this.widthOffset = (this.gamestage.canvas.width - this.mapData.tilesets[0].tilewidth * this.mapData.layers[0].width) / 2;
	} else {
		this.widthOffset = 0;
	}


	// getting imagefile from first tileset
	this.tileset.src = this.mapData.tilesets[0].image;

	this.advance = function() {
		this.advancing = true;
	};

	this.reverse = function() {
		this.reversing = true;
	};

	this.nextMap = function(mapData, x, y) {
		console.log("rendering next map");
		this.stage.removeAllChildren();
		this.gamestage.removeAllChildren();
		//this.container.removeAllChildren();

		this.container.x = 0;
		this.container.y = 0;

		this.tileset = new Image();
		this.mapData = mapData;

		this.heightOffset = 0;//x;
		this.widthOffset = 0;//y;
		this.collisionArray = [[],[]];
		this.advancing = false;
		this.advancecount = 0;
		this.reversing = false;
		this.reversecount = 0;

		this.tileset.src = this.mapData.tilesets[0].image;

		this.initLayers();
	};

	// loading layers
	this.initLayers = function() {
		var w = this.mapData.tilesets[0].tilewidth;
		var h = this.mapData.tilesets[0].tileheight;
		var imageData = {
			images : [ this.tileset ],
			frames : {
				width : w,
				height : h
			}
		};

		// create spritesheet
		var tilesetSheet = new createjs.SpriteSheet(imageData);
		// loading each layer at a time
		var mapData = this.mapData;
		for (var i = 0; i < this.mapData.layers.length; i++) {
			var layer = this.mapData.layers[i];
			if (layer.type === 'tilelayer') {
				if (i === 0) { // layer one is ground collision layer
					this.collisionArray = this.initLayer(layer, tilesetSheet, mapData.tilewidth, mapData.tileheight, this.heightOffset, this.widthOffset);
				}
				this.initLayer(layer, tilesetSheet, mapData.tilewidth, mapData.tileheight, this.heightOffset, this.widthOffset);
			}
		}

		this.stage.addChild(this.container);

	};

	// layer initialization
	this.initLayer = function(layerData, tilesetSheet, tilewidth, tileheight, heightOffset, widthOffset) {
		var collisionArray = new Array(layerData.height);
		for ( var y = 0; y < layerData.height; y++) {
			collisionArray[y] = new Array(layerData.width);
			for ( var x = 0; x < layerData.width; x++) {
				// create a new Bitmap for each cell
				var cellBitmap = new createjs.Sprite(tilesetSheet);
				// layer data has single dimension array
				var idx = x + y * layerData.width;
				// tilemap data uses 1 as first value, EaselJS uses 0 (sub 1 to load correct tile)
				cellBitmap.gotoAndStop(layerData.data[idx] - 1);
				// isometrix tile positioning based on X Y order from Tiled
				cellBitmap.x = widthOffset + x * tilewidth;//300 + x * tilewidth/2 - y * tilewidth/2;
				cellBitmap.y = heightOffset + y * tileheight; // * tileheight/2 + x * tileheight/2;
				// add bitmap to gamestage
				this.container.addChild(cellBitmap);
				// internalgamestage.addChild(cellBitmap);
				if (layerData.data[idx] !== 0) {
					collisionArray[y][x] = true;
				} else {
					collisionArray[y][x] = false;
				}
			}
		}
		//return internalgamestage;
		return collisionArray;
	}

	this.tickActions = function(actions) {
		if (this.advancing) {
			if (this.advancecount < 60) {
				this.advancecount++;
				this.stage.x -= 11;
			} else {
				this.advancecount = 0;
				this.advancing = false;
			}
		}

		if (this.reversing) {
			if (this.reversecount < 60) {
				this.reversecount++;
				this.stage.x += 11;
			} else {
				this.reversecount = 0;
				this.reversing = false;
			}
		}

	};
	// Map data created on Tiled map editor (mapeditor.org). Use export for JSON format
}

